# Tokenize the corpus into bi-grams
corpus_tokens = corpus.split()
bi_grams = list(bigrams(corpus_tokens))

# Calculate the frequency of each bi-gram in the corpus
bi_gram_freq = Counter(bi_grams)

# Calculate the probability of a sentence using bi-grams
def calculate_sentence_probability(sentence):
    sentence_tokens = sentence.split()
    sentence_bi_grams = list(bigrams(sentence_tokens))
    
    probability = 1.0
    for bi_gram in sentence_bi_grams:
        bi_gram_count = bi_gram_freq.get(bi_gram, 0)
        bi_gram_total = len(corpus_tokens) - 1
        bi_gram_probability = bi_gram_count / bi_gram_total
        
        probability *= bi_gram_probability
    
    return probability

